CREATE MATERIALIZED VIEW stream_query AS SELECT t_1.c11 AS col_0 FROM m7 AS t_0 RIGHT JOIN alltypes1 AS t_1 ON t_0.col_0 = t_1.c9 WHERE t_1.c1 GROUP BY t_1.c6, t_1.c2, t_1.c11, t_0.col_1, t_1.c9 HAVING false;
