CREATE MATERIALIZED VIEW stream_query AS WITH with_0 AS (SELECT t_2.col_1 AS col_0 FROM nation AS t_1 LEFT JOIN m2 AS t_2 ON t_1.n_name = t_2.col_2 WHERE false GROUP BY t_2.col_2, t_1.n_comment, t_2.col_3, t_2.col_1 HAVING ((SMALLINT '32767') = t_2.col_3)) SELECT TIME '10:57:31' AS col_0, 'mkKrokErqB' AS col_1 FROM with_0 WHERE true;
